import './dashboard.css';
import Tile from "../../Components/Tile/tile.jsx"

const Dashboard = () => {
  return (
    <div>
        <div className='container'>
            <MenuBar />
        </div>
        <div className="main-container"> 
            <div className="menu-container">
                <Tile text="Apply for Certificate" image={applyCertificate}  />
                <Tile text="Apply for Certificate" image={applyCertificate}  />
                <Tile text="Apply for Certificate" image={applyCertificate}  />
            </div>
        </div>
    </div>
  );
};

